CREATE TABLE `resources` (
  `resourceID` int(6) NOT NULL,
  `mainLanguage` enum('en','de','fr','it') NOT NULL DEFAULT 'en',
  `federationID` smallint(6) NOT NULL DEFAULT '0',
  `homeURL` varchar(255) NOT NULL DEFAULT '',
  `providerID` varchar(255) NOT NULL DEFAULT '',
  `homeOrg` varchar(64) NOT NULL DEFAULT '',
  `validFrom` date NOT NULL DEFAULT '0000-00-00',
  `validUntil` date NOT NULL DEFAULT '0000-00-00',
  `errorURL` varchar(255) DEFAULT NULL,
  `relyingParty` varchar(255) NOT NULL,
  `visible` enum('true','false') NOT NULL DEFAULT 'true',
  `setup` varchar(16) DEFAULT NULL,
  `privateKey` varchar(128) DEFAULT NULL,
  `certificate` varchar(128) DEFAULT NULL,
  `librarypath` varchar(128) DEFAULT NULL,
  `monitor` enum('YES','NO') NOT NULL DEFAULT 'NO',
  `mon_ping` enum('YES','NO') NOT NULL DEFAULT 'NO',
  `mon_time` enum('YES','NO') NOT NULL DEFAULT 'NO',
  `mon_cert` enum('YES','NO') NOT NULL DEFAULT 'NO',
  `mon_shib` enum('YES','NO') NOT NULL DEFAULT 'NO',
  `mon_http` enum('YES','NO') NOT NULL DEFAULT 'NO',
  `publish` enum('true','false','wiki') NOT NULL,
  PRIMARY KEY (`resourceID`),
  KEY `providerID` (`providerID`),
  KEY `targetURI` (`homeURL`),
  KEY `homeOrg` (`homeOrg`),
  KEY `validFrom` (`validFrom`),
  KEY `validUntil` (`validUntil`),
  KEY `federationID` (`federationID`)
